g2:c.PROCEDURE.g2:a.TEXT:
set-value-into-sparse-matrix (Matrix: class sparse-matrix, Row: integer, Col: integer, NewVal: quantity)

Index, Pos: integer;
Indices: class integer-array = the indices of Matrix;
Vals: class quantity-array = the stored-values of Matrix;
Length: integer;

begin 

Index = Row * (the columns of Matrix) + Col;
Pos = call g2-get-position-of-element-in-array (Index, the indices of sparse-matrix-1);
if Pos < 0 then begin
    Length = the array-length of Indices;
    change the array-length of Indices to Length + 1;
    change the array-length of Vals to Length + 1;
    change Indices[Length] = Index;
    change Vals[Length] = NewVal;
end else begin
    change Vals[Pos] = NewVal;
end;

end

get-value-from-sparse-matrix (Matrix: class sparse-matrix, Row: integer, Col: integer) = (quantity)

Index, Pos: integer;

begin 

Index = Row * (the columns of Matrix) + Col;
Pos = call g2-get-position-of-element-in-array (Index, the indices of sparse-matrix-1);
if Pos < 0 then 
    return 0.0    {*** default value ***}
else 
    return (the stored-values of Matrix)[Pos];

end

my-data-setter (Sheet: class gxl-spreadsheet, Row: integer, Col: integer, NewVal: value, Win: class ui-client-item) 

begin

if NewVal = "!nv" then 
    NewVal = 0.0;  {*** No-value is not a legal entry into a sparse matrix ***}
inform the operator that "Setting R[row] C[Col]";
call set-value-into-sparse-matrix (sparse-matrix-1, Row, Col, NewVal);

end

make-external-data-spreadsheet (Spec: class gxl-root-specification, Win: class ui-client-item)

WS: class kb-workspace;
Sheet: class gxl-spreadsheet;
View: class gxl-spreadsheet-view;

begin

conclude that the gxl-total-rows of row-controller-1 = the rows of sparse-matrix-1 + 1;
conclude that the gxl-total-columns of col-controller-1 = the columns of sparse-matrix-1;
create a kb-workspace WS;
change the background-color of WS to extra-light-gray;
Sheet = call gxl-create-spreadsheet (Spec, Win);
change the name of Sheet to the symbol SHEET1;
transfer Sheet to the workspace of this procedure;
View = call gxl-create-spreadsheet-view (Sheet, Spec, WS, 0, -300, Win);
change the size of WS to minimum;
show WS on Win with its center at the center of the screen;

end

example-data-getter (Sheet: class gxl-spreadsheet, Row: integer, Col: integer) = (value)

Quant: quantity;

begin

inform the operator that "getting R[Row] C[Col]";  

if Col = 0 and Row = 0 then 
    return "" 
else if Col = 1 and Row = 0 then 
    return "A Large Matrix"  
else if Col = 0 then 
    return Row  {*** for row selector cells ***}
else begin
    Quant = call get-value-from-sparse-matrix (sparse-matrix-1, Row, Col);
    return Quant;
end;

end

do-all-test(node: class benchmark-node)
status : truth-value; 
status-text: text;
begin
    status,status-text = call do-all-test-inner();
    if status
        then call fail(node, status-text)
        else call pass(node); 
end

do-all-test-inner () = (truth-value, text)
er : class error;
msg : text;
w : class g2-window; 
begin
    w = call get-main-g2-window(); 
    call make-external-data-spreadsheet(spec2,w);
    begin
        call gxl-set-color-pattern-of-cell-to-default (Sheet1, 100, 100, w);
    end
    on error(ER)
        msg = "[the text of the error-description of er]";
        delete ER;
        if is-contained-in-text ("The local name DEFAULT-BKGROUND was referenced when it had no value",msg) then
            return true,"Regression occured: DEFAULT-BKGROUND was referenced when it had no value"
        else
            return true,"Test failed in an unexpected manner: [msg]";
    end;
    return false,""
end
